values:
Why&nbsp; does school have to start so early in the morning? I guess it's my fault being as I scheduled my classes this early but it's still annoying.&nbsp; Plus I always get her like a half hour early because it's either that or be late D; But I'm done at 1:30 today and that is my favorite. And next week is SPRING BREAK!&nbsp; I'm so excited.&nbsp; Sure I have 2 midterms on friday but then I get 9 days off in a row, with no homework.&nbsp; I'm way jazzed about it. Although I am going to continue to come into work, but we get to chose when we work so I think I'm going to stratigically place my times so that I don't have to deal woth rush hour.

I'm going to go get my new phone after I get out of class today.&nbsp; I know the phone I have now isn't even a year old but I'm switching over to Cricket and new plans usually necessitate a new phone.&nbsp; Either way I'm making my way toward unlimited minutes which means I can talk all the time and not worry.&nbsp; I'm so excited for the freedom of it.&nbsp; And I'll be able to talk to Shelley more because we won't be confined to when I'm at the house :D&nbsp;&nbsp;

My class starts in 8 minitues.&nbsp; I should probably head over there :p&nbsp;&nbsp;

Oh and I don't work at Toys on Friday if anyone wants to give me a hollar.&nbsp; I'm out of work at the admissions office at 5 so that leaves the whole night free :3

&nbsp;Oh man, Sera and I are too cool some times.&nbsp; We totally went glow golfing today XD&nbsp; And I don't care what any of you say it was fun.&nbsp; And actually a little tiring.&nbsp; The people that were golfing behing us caught up to us so we kind of powered through the second half.&nbsp; I got a hole in one though so I'm happy :D&nbsp;&nbsp; I didn't even cheat on that hole!

And now I really need to write my paper....I'm skipping most of my classes tomorrow to go to crepe day but that means I need to finish my paper at a reasonable hour.&nbsp; We turn them in online and give a hard copy in class.&nbsp; I'll have to drop the hard copy off in his box since I'm not going to that class but this means I need to get the paper finished so that my teacher doesn't think I'm turning in my paper later because I needed more time to work on it.&nbsp;&nbsp;

Yeah...I'm going to stop procrastinating now.&nbsp; Golfing was fun XD
